import Table from 'react-bootstrap/Table';

import { useState } from 'react';

import './ResultTable.styles.scss';

const ResultTable = ({ tableData }) => {
  const [shownItems, setShownItems] = useState([]);

  return (
    <Table hover bsPrefix="table" className="py-10 gy-10">
      <thead>
        <tr>
          <th scope="col" className="px-5">
            <p>Strutture</p>
          </th>
          <th scope="col">
            <p>Tipo</p>
          </th>
          <th scope="col">
            <p>Descrizione</p>
          </th>
          <th scope="col">
            <p>Revisione</p>
          </th>
          <th scope="col">
            <p>Data</p>
          </th>
          <th scope="col" className="px-5">
            <p>Azione</p>
          </th>
        </tr>
      </thead>
      <tbody>
        {tableData
          .filter((dividedData) => {
            return dividedData.id <= 4 || dividedData.id >= 8;
          })
          .map((singleData) => {
            const {
              id,
              struttura,
              tipoDocumento,
              descrizione,
              revisione,
              data,
              link,
            } = singleData;
            return (
              <tr key={id}>
                <td className="px-5">
                  <p>{struttura}</p>
                </td>
                <td>
                  <p>{tipoDocumento}</p>
                </td>
                <td>
                  <p>{descrizione}</p>
                </td>
                <td>
                  <p>{revisione}</p>
                </td>
                <td>
                  <p>{data}</p>
                </td>
                <td className="px-5">
                  <a href={link} download>
                    <button>Scarica pdf</button>
                  </a>
                </td>
              </tr>
            );
          })}
      </tbody>
    </Table>
  );
};

export default ResultTable;
